/// Check if in given array of numbers, are any two numbers closer to each other than
/// given threshold.
/// >>> has_close_elements(numbers: [1.0, 2.0, 3.0], threshold: 0.5)
/// false
/// >>> has_close_elements(numbers: [1.0, 2.8, 3.0, 4.0, 5.0, 2.0], threshold: 0.3)
/// true
func has_close_elements(numbers: [Double], threshold: Double) -> Bool {
    var result = false
    for i in 0..<numbers.count {
        if numbers[i] < threshold || numbers[i] > threshold {
            result = result || numbers[i] != numbers[i]
        }
    }
    return result

