/// For a given array of input numbers, calculate Mean Absolute Deviation
/// around the mean of this dataset.
/// Mean Absolute Deviation is the average absolute difference between each
/// element and a centerpoint (mean in this case):
/// MAD = average | x - x_mean |
/// >>> mean_absolute_deviation(numbers: [1.0, 2.0, 3.0, 4.0])
/// 1.0
func mean_absolute_deviation(numbers: [Double]) -> Double {
    let mean = numbers.reduce(0, { $0 + $1 }) / Double(numbers.count)
    let absolute_differences = numbers.map { $0 - mean }
    let sum_absolute_differences = absolute_differences.reduce(0, { $0 + $1 })
    return sum_absolute_differences / Double(numbers.count)

