    if s.count < 3 {
        return false
    }
    var i = 0
    var j = 0
    while i < s.count && j < s.count {
        if s[i] == s[j] {
            i += 1
            j += 1
        } else if s[i] == s[j] && s[i] != s[j] {
            i += 1
            j += 1
        } else {
