func fix_spaces(text: String) -> String {
    var result = text
    let regex = try NSRegularExpression(pattern: "([\s\S]+)", options: [])
    let matches = regex.matches(in: text, options: [], range: NSRange(0, text.count))
    for match in matches {
        let start = text.index(text.startIndex, offsetBy: match.range.start)
        let end = text.index(text.startIndex, offsetBy: match.range.end)
        let substring = text.substring(to: start, length: end - start)
