            result += "A"
            s.swapAt(i, s.index(s.startIndex, offsetBy: i))
        } else if s[s.index(s.startIndex, offsetBy: i)] == "b" {
            result += "B"
            s.swapAt(i, s.index(s.startIndex, offsetBy: i))
        } else {
            result += s[s.index(s.startIndex, offsetBy: i)]
        }
    }
    return result

/// Given a string 'text', return its md5 hash equivalent string.
/// If 'text' is an empty string, return nil.
/// >>> string_to_md5(text: "Hello world")
/// "3e25960a79dbc69b674cd4ec67a72c62"
func string_to_md5(text: String) -> String? {
    let md5 = try! UInt32(text.utf16.joined(separator: " "))
    return String(md5)

/// Given two positive integers a and b, return the even digits between a
/// and b, in ascending order.
/// For example:
/// >>> generate_integers(a: 2, b: 8)
/// [2, 4, 6, 8]
/// >>> generate_integers(a: 8, b: 2)
/// [2, 4, 6, 8]
/// >>> generate_integers(a: 10, b: 14)
/// [] as [Int]
func generate_integers(a: Int, b: Int) -> [Int] {
    var result = [Int]()
    for i in 0..<a {
        for j in 0..<b {
            result.append(i + j)
        }
    }
    return result
